ก.พ.มอบหมาย
2) ศึกษา วิเคราะห์ วิจัยเกี่ยวกับการบริหารงานบุคคลในราชการฝ่ายพลเรือน 
3) พัฒนาระบบข้อมูล และจัดทำแผนกำลังคนในราชการฝ่ายพลเรือน
4) ส่งเสริม ประสานงาน เผยแพร่ ให้คำปรึกษาแนะนำ และดำเนินการเกี่ยวกับการจัดสวสัดิการสำหรับข้าราชการพลเรือน
5) ประสานงานและดำเนินงานเกี่ยวกับการพัฒนาข้าราชการพลเรือน
6) ดำเนินการเกี่ยวกับทุนของรัฐบาล เพื่อสนองความต้องการกำลังคนของกระทรวง ทบวง กรม ฝ่ายพลเรือน และทุนเล่าเรียนหลวง ตลอดจนการจัดสรรผู้รับทุนของรัฐบาลที่สำเร็จการศึกษาแล้วเข้ารับราชการในส่วนราชการต่างๆ ตามนโยบายและระเบียบที่ ก.พ. กำหนด
7) ดำเนินการเกี่ยวกับการดูแลข้าราชการฝ่ายพลเรือนที่ศึกษา หรือฝึกอบรมในต่างประเทศ และการดูแลจัดการศึกษาของนักเรียนฝ่ายพลเรือนในต่างประเทศ
8) ดำเนินการเกี่ยวกับการรับรองคุณวุฒิของผู้ได้รับปริญญา ประกาศนียบัตรวิชาชีพ หรือคุณวุฒิอย่างอื่น เพื่อประโยชน์ในการบรรจุและการแต่งตั้งข้าราชการพลเรือน และการกำหนดเงินเดือนที่ควรได้รับและระดับตำแหน่งที่จะแต่งตั้ง
9) ดำเนินการเกี่ยวกับการรักษาทะเบียนประวัติ และการควบคุมการเกษียณอายุของข้าราชการพลเรือน
10) จัดทำรายงานประจำปีเกี่ยวกับการบริหารงานบุคคลในราชการพลเรือนเสนอต่อ ก.พ.
11) ปฏิบัติการอื่นใดตามที่กฎหมายกำหนดให้เป็นอำนาจหน้าที่ของสำนักงานคณะกรรมการข้าราชการพลเรือน หรือตามที่นายกรัฐมนตรี หรือคณะรัฐมนตรีมอบหมาย',2892,1,1,'2004-01-08 15:14:09',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
